"const axios = require('axios');
const yts = require('yt-search');

const SaveTube = {
    formats: ["audio", "video"],

    qualities: {
        audio: {
            1: '32',
            2: '64',
            3: '128',
            4: '192'
        },
        video: {
            1: '144',
            2: '240',
            3: '360',
            4: '480',
            5: '720',
            6: '1080',
            7: '1440',
            8: '2160'
        }
    },

    headers: {
        'accept': '*/*',
        'referer': 'https://ytshorts.savetube.me/',
        'origin': 'https://ytshorts.savetube.me/',
        'user-agent': 'Postify/1.0.0',
        'Content-Type': 'application/json'
    },

    cdn() {
        return Math.floor(Math.random() * 11) + 51;
    },

    checkQuality(type, qualityIndex) {
        if (!(qualityIndex in this.qualities[type])) {
            throw new Error(` Kualitas ${type} tidak valid. Pilih salah satu: ${Object.keys(this.qualities[type]).join(', ')}`);
        }
    },

    async fetchData(url, cdn, body = {}) {
        const headers = {
            ...this.headers,
            'authority': `cdn${cdn}.savetube.su`
        };

        try {
            const response = await axios.post(url, body, {
                headers
            });
            return response.data;
        } catch (error) {
            console.error(error);
            throw error;
        }
    },

    dLink(cdnUrl) {
        return `https://${cdnUrl}/download`;
    },

    async dl(link, qualityIndex, type) {
        const quality = this.qualities[type][qualityIndex];
        if (!this.formats.includes(type)) throw new Error(' Tipe tidak valid. Pilih audio atau video.');
        this.checkQuality(type, qualityIndex);
        const cdnNumber = this.cdn();
        const cdnUrl = `cdn${cdnNumber}.savetube.su`;

        const videoInfo = await this.fetchData(`https://${cdnUrl}/info`, cdnNumber, {
            url: link
        });
        const badi = {
            downloadType: type,
            quality: quality,
            key: videoInfo.data.key
        };

        const dlRes = await this.fetchData(this.dLink(cdnUrl), cdnNumber, badi);

        return {
            download: dlRes.data.downloadUrl,
            duration: videoInfo.data.duration,
            durationLabel: videoInfo.data.durationLabel,
            fromCache: videoInfo.data.fromCache,
            id: videoInfo.data.id,
            key: videoInfo.data.key,
            thumbnail: videoInfo.data.thumbnail,
            thumbnail_formats: videoInfo.data.thumbnail_formats,
            title: videoInfo.data.title,
            titleSlug: videoInfo.data.titleSlug,
            videoUrl: videoInfo.data.url,
            quality,
            type
        };
    }
};

async function downloadImage(url) {
    try {
        const response = await axios.get(url, {
            responseType: 'arraybuffer'
        })
        return Buffer.from(response.data, 'binary')
    } catch (error) {
        return null
    }
}

